    public function getSourceContext()
    {
        return new Twig_Source("{% trans_default_domain 'FOSUserBundle' %}

<link rel=\"stylesheet\" href=\"{{ asset('assets/login.css') }}\"/>


<div class=\"row\" style=\"margin-left:0;margin-right:0;\">

<div class=\"col-md-4\"></div>

<div class=\"col-md-4 card\" style=\"padding:10px;margin-top:150px;\">
<h1 class=\"text-center\"> LOGIN</h1>
<div class=\"\"clearfix\"></div>
<hr/>

{% if error %}
      <div class=\"text-danger\"> <b> <i>  {{ error.messageKey|trans(error.messageData, 'security') }} <i> </b></div>
{% endif %}

<div class=\"clearfix\"></div>

<form action=\"{{ path(\"fos_user_security_check\") }}\" method=\"post\">
    {% if csrf_token %}
        <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token }}\" />
    {% endif %}

    <label for=\"username\">{{ 'security.login.username'|trans }}</label>
    <input type=\"text\" id=\"username\" name=\"_username\" value=\"{{ last_username }}\" required=\"required\" autocomplete=\"username\" />

    <label for=\"password\">{{ 'security.login.password'|trans }}</label>
    <input type=\"password\" id=\"password\" name=\"_password\" required=\"required\" autocomplete=\"current-password\" />

    <input type=\"checkbox\" id=\"remember_me\" name=\"_remember_me\" value=\"on\" />
    <label for=\"remember_me\">{{ 'security.login.remember_me'|trans }}</label>

    <input type=\"submit\" id=\"_submit\" name=\"_submit\" value=\"{{ 'security.login.submit'|trans }}\" />
</form>
</div>
</div>




", "@FOSUser/Security/login_content.html.twig", "/var/www/html/HighCourt/vendor/friendsofsymfony/user-bundle/Resources/views/Security/login_content.html.twig");
